import React from 'react';
import './WhatIveLearn.scss';
import {SmlCard} from './SmallCard/SmarllCard';

export const WhatIveLearn = () => {
return (
    <div className="card">
        <h1>What I've learned here</h1>
        <div className="cardsWrapper"></div>
        <SmlCard title="Filter method" text="Test du text"/>
        <SmlCard title="Filter method" text="Et hoop un 2 test"/>
    </div>
)
}
